description:
The BR232 for Train Simulator is available in Deutsche Bahn Orient Red and Traffic Red, and Railion liveries and features functioning SiFa driver vigilance system, dynamic braking, switchable fuel pump and drive mode, cab lighting, sun visors, Facns, Shimms and Hbbills freight wagons. 

The locomotive is also Quick Drive compatible, giving you the freedom to drive the BR232 on any Quick Drive enabled route for Train Simulator. Also included are scenarios specifically for the Munich-Augsburg route (available separately and required to play these scenarios).



Please support the developers and buy some of their content if you can afford it.


